import React from 'react';
import Header from './components/header';
import Feed from './components/feed';
import ScrollFeed from './components/scrollFeed';
import './app.css';

function App() {
  return (
    <div className="App">
      <Header />
      <main className="content">
        <ScrollFeed />
        <Feed />
      </main>
    </div>
  );
}

export default App;
